CREATE TABLE USER
(
    USERNAME TEXT NOT NULL,
    PASSWORD TEXT NOT NULL,
    PASSWORD_SALT TEXT NOT NULL
);
CREATE UNIQUE INDEX USER_USERNAME_uindex ON USER (USERNAME);

CREATE TABLE USER_ROLES
(
    USERNAME TEXT,
    ROLE TEXT
);

CREATE TABLE ROLES_PERMS
(
    ROLE TEXT,
    PERM TEXT
);

CREATE TABLE ct
(
    id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
    type TEXT NOT NULL,
    file TEXT NOT NULL,
    diagnosis TEXT,
    recordId INTEGER NOT NULL
);

CREATE TABLE record
(
    id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
    diagnosis TEXT,
    username TEXT
);

CREATE TABLE feature
(
    f1 REAL NOT NULL,
    f2 REAL NOT NULL,
    f3 REAL NOT NULL,
    f4 REAL NOT NULL,
    f5 REAL NOT NULL,
    f6 REAL NOT NULL,
    f7 REAL NOT NULL,
    f8 REAL NOT NULL,
    f9 REAL NOT NULL,
    f10 REAL NOT NULL,
    f11 REAL NOT NULL,
    f12 REAL NOT NULL,
    f13 REAL NOT NULL,
    f14 REAL NOT NULL,
    f15 REAL NOT NULL,
    f16 REAL NOT NULL,
    f17 REAL NOT NULL,
    f18 REAL NOT NULL,
    f19 REAL NOT NULL,
    f20 REAL NOT NULL,
    f21 REAL NOT NULL,
    f22 REAL NOT NULL,
    f23 REAL NOT NULL,
    f24 REAL NOT NULL,
    f25 REAL NOT NULL,
    f26 REAL NOT NULL,
    label INTEGER NOT NULL
);







